  "text" : "\uC0AC\uB78C\uB4E4\uC740 \uB274\uC2A4\uB97C \uBCF4\uBA74\uC11C \uC900\uBC95\uC5D0 \uB300\uD55C \uD68C\uC758\uB97C \uB290\uB07C\uAC70\uB098, \uC790\uAE30\uB3C4 \uCC98\uBC8C\uBC1B\uC9C0 \uC54A\uC73C\uB9AC\uB780 \uD658\uC0C1\uC744 \uAC00\uC9C0\uC8E0. \uB530\uB77C\uC11C \uBC94\uC8C4\uC728\uC744 \uB0AE\uCD94\uB824\uBA74 \uC911\uBC8C\uC8FC\uC758\uB85C \uB098\uAC00\uAE30 \uBCF4\uB2E4\uB294, \uC8C4\uB97C \uC9D3\uACE0 \uBE60\uC838\uB098\uAC00\uB294 \uC0AC\uB78C\uB4E4\uC774 \uC5C6\uB2E4\uB294 \uC778\uC2DD\uC744 \uC2EC\uC5B4\uC918\uC57C \uD569\uB2C8\uB2E4.",
