  "text" : "\uC27D\uAC8C \uC608\uB97C \uB4E4\uC5B4\uBCF4\uC790\uBA74, \uC790\uAE30\uAC00 100% \uC801\uBC1C\uB418\uC5B4 \uCC98\uBC8C\uBC1B\uC744 \uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uD558\uBA70 \uC74C\uC8FC\uC6B4\uC804\uC744 \uD558\uB294 \uC0AC\uB78C\uC740 \uC5C6\uC2B5\uB2C8\uB2E4. \uB2E4\uB4E4 '\uC9C0\uAE08\uC740 \uB2E8\uC18D\uC774 \uC5C6\uC744\uAEBC\uC57C. \uC124\uB9C8 \uB0B4\uAC00 \uAC78\uB9AC\uACA0\uC5B4?' \uB77C\uACE0 \uC0DD\uAC01\uD558\uBA70 \uC74C\uC8FC\uC6B4\uC804\uC744 \uD558\uC8E0.",
